import React from 'react'
import '../Internal.css'

const Quotes = () => {
    return (
        <div className='quote-box'>
            <p className='quote-p'>
                what is going on ?
                <strong className='quote-strong'>
                    - bradley lopez
                </strong>
            </p>
        </div>
    )
}

export default Quotes;
